import React from "react";

import { Typography } from "antd";

import { Container, Card, Header } from "semantic-ui-react";

export default function Home() {
  return (
    <Container textAlign="center">
      <Header as="h1" color="teal">
        eCommerce Application
      </Header>
    </Container>
  );
}
